import React, { Component } from 'react';

export class Home extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col l4 s12">
            <div className="col l4 s12">1</div>
            <div className="col l2 s6">2</div>
            <div className="col l4 s6">3</div>
          </div>

          <div className="col l4 s12">
            <div>4</div>
          </div>

          <div className="col l4 s12">

            <div className="col l2 s6">5</div>
            <div className="col l2 s6">6</div>
            <div className="col l4 s12">7</div>

          </div>

        </div>
      </div>
    )
  }
}

export default Home;
